import Vue from 'vue'
import App from './App.vue'
import store from "./store/index";
import { Container, Header, Main, Footer, Aside } from 'element-ui';

Vue.config.productionTip = false
// 引入整体布局的Element-UI
// /* Vue.use(Container)
// Vue.use(Header)
// Vue.use(Main)
// Vue.use(Footer)
// Vue.use(Aside) */
// Vue.use(Container, Header, Main, Footer, Aside)

new Vue({
  render: h => h(App),
  store
}).$mount('#app')
